package week1.day1;

public class FibbinocciSeries {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num1 = 0;
		int num2 = 1;
		int num3;
		int i;
		int sum=11;
		System.out.println(num1);
		for(i = 2; i < sum; ++i) {
			num3=num1+num2;
			
			System.out.println(""+num3);
			num1=num2;
			num2=num3;
			
			
		
		
		
	}
}
}
		
		

